k = d*e-1

def findt(n):
    t = 0
    while n%2==0:
        n = n//2
        t+=1
    return t

def findpq(g):
    global k
    t = findt(k)
    kt = k
    for i in range(t):
        kt = kt // 2
        x = pow(g,kt,n)
        y = gcd(x-1,n)

        if x>1 and n>y>1:
            p = y
            q = n//y
            if p*q==n:
                return p, q
    return -1, -1

p, q = findpq(5)
assert p*q == n

phi = (p-1)*(q-1)
e2 = 6767671
d = pow(e2,-1,phi)
m = pow(ct,d,n)

flag = long_to_bytes(m).decode()
print(flag)
